import React from 'react';


const SkillColumn = (props) => {

    const thisClassName = "fa " + props.icon + " fa-2x";

    return(
        <React.Fragment>
            <div className="container">
                <div className="row">
                    <div className="col-lg-2 col-md-4 col-sm-6">
                        <div>hello world.</div>
                    </div>
                </div>
            </div>

        </React.Fragment>

    );
}

export default SkillColumn;
